import React from 'react';
import ExpenseItem from './ExpenseItem';

export default function ExpensesList(props) {
    let expensesContent = <p class="errorMessage">No expenses for this year</p>;

    if (props.items.length > 0) {
        expensesContent = props.items.map((filtered_item) => (
        <ExpenseItem
            key={filtered_item.id}
            title={filtered_item.title}
            price={filtered_item.price}
            date={filtered_item.date}
        />
        ))
    };
}
